        <div>
            <h3>Todo App</h3>
            <div style={{border:"solid black",display:"flex",justifyContent:"space-between",alignItems:"center"}}>
                <div >
                <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike" onClick={cllicked}/>
                {/* <div onClick={check}>click me</div> */}
                <label for="vehicle1"> I have a bike</label>
                </div>
                <div>
                {(!setCheck) ? null : "completed"}
                </div>
            </div>
        </div>
    )
}

